import React, { Component } from 'react';
import { Helmet } from 'react-helmet';
import { Link } from 'react-router-dom';
import OwlCarousel from 'react-owl-carousel';
import 'owl.carousel/dist/assets/owl.carousel.css';
import 'owl.carousel/dist/assets/owl.theme.default.css';

export default class SalesForce extends Component {
  render() {

    const options = {
        loop: false,
        margin: 0,
        items: 1,
        autoplay: false,
        dots: false,
        autoplay: false,
        dots: false
    }; 
    return(
        <div className='blog-page'>
            <Helmet>
                <title>Scritpics | Blogs</title>
                <meta name="description" content= "Blogs" />
                <body id="page-blogs" />
            </Helmet>
            <section className='srv-main'>
                <OwlCarousel className="owl-theme" {...options}>
                    <div className='slide-1'>
                        <div className='slide-img'>
                            <img src="/assets/img/AIandAutomation/Banner/AI-for-gaming.jpg" alt='AIforGaming' />
                        </div>
                        <div className='caption'>
                            <div className='container'>
                            <div className='row'>
                                <div className="col-12 col-lg-7 col-md-8 col-sm-12 col-xs-12 home_banner fadeInUp animated from-right">
                                <div className='slide_content'>
                                    <p className="case-cat">Case Studies - AI & Automation</p>
                                    <h1 className="h2-heading white-color mb-xs-10">CREATING NEW BENCHMARK FOR DIGITAL DENTISTRY WITH AI WORLDâ€™S FIRST END TO END SOLUTION</h1>
                                    <Link className="btn btn-shutter-more text-uppercase" to="/case_study_automation">explore</Link>   
                                </div>
                                </div>
                            </div>
                            </div>
                        </div>
                    </div>
                </OwlCarousel>
            </section>
        </div>
    )
 }
}
